                font-family: Montserrat;
                font-size: 23px;
                background-color: #000000;
                background-image: linear-gradient(0deg, #000000 0%, #414141 74%);
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
                top: 177px;
                color: #2FA4E7;
                border: black;
                z-index: 1;
                border: 5px green solid;
            } 

            .search-bar-parent {
                pointer-events: none;
                position: absolute;
            }

            .search-bar-png2 {
                width: 1507px;
