            }

            .oea-title {
                display: none;
            }

            .oea-text {
                font-family: Montserrat;
                font-size: 38px;
                bottom: 4px;
                position: absolute;
                left: 523px;
            }

            .oea-content {
                font-family: Montserrat;
                font-size: 38px;
                position: relative;
                width: 1507px;
                height: 76px;
                border: 5px yellow solid;
            }


            .back-button-svg {
                height: 66px;
