                position: absolute;

                left:800px;
            }

            .iris-svg {
                height: 66px;
                width: 66px;
                position: absolute;

                left:876px;
            }



            .sound-svg {
                height: 66px;
                width: 66px;
                position: absolute;

                left: 286px;
            }

            .next-template-svg {
                height: 66px;
                width: 66px;
                position: absolute;
                left:920px;
            }

            .right-hexagons {
                height: 66px;
                width: 177px;
                position: absolute;
                left: 1006px;
            }

            .snake-svg {
                height: 66px;
                width: 66px;
                position: absolute;

                left: 1420px;
            }






            `}</style>







        </div>
    );
  }
}

  export default Dock;



